function End_Target_MiniG () {
    if (STOP_ == 0) {
        if (In_Range == 2) {
            info.stopCountdown()
            game_over_screen = 1
            game.splash(T_score, "Targets hit!")
            tiles.setWallAt(tiles.getTileLocation(25, 2), false)
            tiles.setWallAt(tiles.getTileLocation(25, 3), false)
            tiles.setWallAt(tiles.getTileLocation(25, 4), false)
            tiles.setWallAt(tiles.getTileLocation(25, 5), false)
            tiles.setWallAt(tiles.getTileLocation(25, 6), false)
            if (T_score >= 0) {
                if (T_score >= 6) {
                    if (T_score >= 12) {
                        if (T_score >= 20) {
                            // multishot power
                            game.splash("Perfect score!", "Collect your prize!")
                        } else {
                            // Keycard dispense
                            game.splash("Collect your prize!")
                        }
                    } else {
                        // Water 
                        game.splash("Collect your prize!")
                    }
                } else {
                    game.splash("Better luck next time!", "Do better and the prize will be yours!")
                }
            }
            pause(100)
            game_over_screen = 0
            STOP_ = 1
            sprites.destroy(NaNTarget)
            sprites.destroyAllSpritesOfKind(SpriteKind.target)
            sprites.destroyAllSpritesOfKind(SpriteKind.Projectile)
            scene.cameraFollowSprite(mySprite)
            mySprite.x += 30
            Target_Ammount = 0
            tiles.setTileAt(tiles.getTileLocation(31, 3), sprites.dungeon.chestOpen)
            once = 1
            In_Range = 1
        }
    }
}
sprites.onOverlap(SpriteKind.Projectile, SpriteKind.triiger, function (sprite, otherSprite) {
    ammout_left += -1
    sprites.destroy(sprite)
    if (ammout_left <= 0) {
        if (once == 0) {
            if (In_Range == 1) {
                In_Range = 2
                once = 1
                info.startCountdown(0.01)
            }
        }
    }
})
