controller.B.onEvent(ControllerButtonEvent.Pressed, function () {
    if (Health_touch == 1) {
        game_over_screen = 1
        if (oil_count >= 1 && bandage_count >= 1) {
            if (info.life() < 5) {
                info.changeLifeBy(1)
                bandage_count += -1
                oil_count += -1
            } else {
                game.splash("You already at max health")
            }
        } else {
            if (oil_count == 0 && bandage_count == 0) {
                game.splash("You are missing the", "necessary resources")
            } else {
                if (oil_count == 0) {
                    game.splash("You are missing Water")
                }
                if (bandage_count == 0) {
                    game.splash("You are missing Bandages")
                }
            }
        }
        pause(100)
        game_over_screen = 0
    }
})
