function ammo_simplify () {
    if (vials > 20) {
        vials = 20
        game.splash("Already at max vials")
    }
    if (first_vial == 0) {
        game.splash("You found a vial!")
        if (sling_shot == 0) {
            game.splash("Now you just need to", "find a way to use it.")
        }
        first_vial = 1
    }
}
