controller.menu.onEvent(ControllerButtonEvent.Pressed, function () {
    if (Health_touch == 1) {
        if (bossfight == 0) {
            if (Current_Level >= 3) {
                if (In_Range != 1) {
                    if (Pressed == 0) {
                        if (game_over_screen == 0) {
                            Keycard_check_dis()
                            scene.cameraFollowSprite(backround)
                            controller.moveSprite(mySprite, 0, 0)
                            Pressed = 1
                            game_over_screen = 1
                            if (info.countdown() != 0) {
                                countdown = info.countdown()
                                info.stopCountdown()
                            }
                        }
                    } else {
                        sprites.destroyAllSpritesOfKind(SpriteKind.screen)
                        scene.cameraFollowSprite(mySprite)
                        controller.moveSprite(mySprite, 60, 60)
                        Pressed = 0
                        game_over_screen = 0
                        if (countdown != 0) {
                            info.startCountdown(countdown)
                        }
                    }
                }
            }
        }
    }
})
