sprites.onOverlap(SpriteKind.Player, SpriteKind.AlienDmg, function (sprite, otherSprite) {
    if (stage == 1) {
        sprites.destroy(otherSprite)
        if (Invinceable == 0) {
            info.changeLifeBy(-1)
        }
        controller.moveSprite(mySprite, 0, 0)
        if (characterAnimations.matchesRule(mySprite, characterAnimations.rule(Predicate.FacingLeft))) {
            mySprite.setVelocity(150, 0)
        } else if (characterAnimations.matchesRule(mySprite, characterAnimations.rule(Predicate.MovingRight))) {
            mySprite.setVelocity(-150, 0)
        } else if (characterAnimations.matchesRule(mySprite, characterAnimations.rule(Predicate.FacingDown))) {
            mySprite.setVelocity(0, -150)
        } else if (characterAnimations.matchesRule(mySprite, characterAnimations.rule(Predicate.FacingUp))) {
            mySprite.setVelocity(0, 150)
        }
        pause(100)
        controller.moveSprite(mySprite, 60, 60)
    } else if (stage == 2) {
        sprites.destroy(otherSprite)
        if (Invinceable == 0) {
            info.changeLifeBy(-1)
        }
        controller.moveSprite(mySprite, 0, 0)
        pause(1500)
        controller.moveSprite(mySprite, 60, 60)
    } else if (stage == 3) {
    	
    }
    if (info.life() == 0) {
        Alein_player_go()
    }
    Invinceable = 1
    pause(1800)
    Invinceable = 0
})
