sprites.onOverlap(SpriteKind.Player, SpriteKind.Enemy, function (sprite, otherSprite) {
    if (Invinceable == 0) {
        info.changeLifeBy(-1)
    }
    if (Current_Level == 8) {
        controller.moveSprite(mySprite, 0, 0)
        if (characterAnimations.matchesRule(mySprite, characterAnimations.rule(Predicate.MovingLeft))) {
            mySprite.setVelocity(150, 0)
        } else if (characterAnimations.matchesRule(mySprite, characterAnimations.rule(Predicate.MovingRight))) {
            mySprite.setVelocity(-150, 0)
        } else if (characterAnimations.matchesRule(mySprite, characterAnimations.rule(Predicate.MovingDown))) {
            mySprite.setVelocity(0, -150)
        } else if (characterAnimations.matchesRule(mySprite, characterAnimations.rule(Predicate.MovingUp))) {
            mySprite.setVelocity(0, 150)
        }
        pause(100)
        controller.moveSprite(mySprite, 60, 60)
        Invinceable = 1
        pause(1800)
        Invinceable = 0
    } else {
        if (careful == 0) {
            Alein_player_go()
        } else {
            controller.moveSprite(mySprite, 0, 0)
            mySprite.follow(follow_me, 110)
            pause(600)
            controller.moveSprite(mySprite, 60, 60)
            mySprite.follow(follow_me, 0)
            if (trigger == 7) {
                mySprite.y += -16
            }
        }
    }
    if (info.life() == 0) {
        Alein_player_go()
    }
})
